import React, { useState, useEffect } from 'react';
import './AdminOrder.css';
import axios from 'axios';
import AppHeader from '../../Components/AppHeader/index.js'; // Import AppHeader component
import Sidebar from '../../Components/Sidebar/sidebar.js'; // Import Sidebar component

const AdminOrder = () => {
  const [orders, setOrders] = useState([]);
  const [searchInput, setSearchInput] = useState('');


  useEffect(() => {
    fetchOrders();
  }, []);

  const fetchOrders = async () => {
    try {
      const response = await axios.get('/api/orders');
      setOrders(response.data);
    } catch (error) {
      console.error(error);
    }
  };

  // Example orders to fill the table
  const exampleOrders = [
    {
      id: 1,
      items: ['Apples from Maleku'],
      quantity: 2,
      totalPrice: 50,
      customerName: 'Shrota Ghimire',
      customerPhone: '9818252988',
      customerLocation: 'Imadole',
      status: 'Pending'
    }
  ];

  const handleSearchInputChange = (e) => {
    setSearchInput(e.target.value);
  };

  const filteredOrders = orders.filter(order =>
    order.items.join(', ').toLowerCase().includes(searchInput.toLowerCase())
  );


  return (
    <div>
           <h1 style={{marginBottom:'30px', fontWeight:'400', fontSize:'24px', marginLeft:'280px'}}>Orders</h1>
      <input
          type="text"
          value={searchInput}
          onChange={handleSearchInputChange}
          placeholder="Search by product name"
          style={{ height:'16px', marginLeft:'280px', marginBottom:'9px', padding: '8px', fontSize: '13px', borderRadius: '4px', border: '1px solid #ddd', width: '400px', maxWidth: '400px' }}
        />

      <Sidebar adminName="Your Admin Name" />
      <div className="admin-order-container">


        <table>
          <thead>
            <tr>
              <th>Order Number</th>
              <th>Items Purchased</th>
              <th>Quantity</th>
              <th>Total Price</th>
              <th>Customer Name</th>
              <th>Customer Phone</th>
              <th>Customer Location</th>
              <th>Order Status</th>
            </tr>
          </thead>
          <tbody>
            {filteredOrders.length > 0 ? (
              filteredOrders.map((order) => (
                <tr key={order.id}>
                  <td>{order.id}</td>
                  <td>{order.items.join(', ')}</td>
                  <td>{order.quantity}</td>
                  <td>{order.totalPrice}</td>
                  <td>{order.customerName}</td>
                  <td>{order.customerPhone}</td>
                  <td>{order.customerLocation}</td>
                  <td>{order.status}</td>
                </tr>
              ))
            ) : (
              exampleOrders.map((order) => (
                <tr key={order.id}>
                  <td>{order.id}</td>
                  <td>{order.items.join(', ')}</td>
                  <td>{order.quantity}</td>
                  <td>{order.totalPrice}</td>
                  <td>{order.customerName}</td>
                  <td>{order.customerPhone}</td>
                  <td>{order.customerLocation}</td>
                  <td>{order.status}</td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default AdminOrder;
